import { Component, Prop, Vue, Watch } from 'vue-property-decorator'

@Component({
  name: 'TabChange'
})
export default class TabChange extends Vue {
  @Prop({ default: 0 }) private value!: number
  @Prop({ default: () => [] }) private tabList!: any[]

  private activeIndex = 0

  @Watch('value')
  private valueChange(val: number) {
    this.activeIndex = val
  }

  created() {
    this.activeIndex = this.value
  }

  private handleClick(activeIndex: number) {
    this.activeIndex = activeIndex
    this.$emit('tabChange', activeIndex)
  }
}
